import React from 'react';
import './Home.css';

function Home(props) {
    return (
        <div>
            
            <div className="banner">
                <div className="container">
                    <div className="group_home_title">
                        <h1 className="h1_title">CODE WITH TIENKIM</h1>
                        <p className="p_title">Rèn luyện bản thân hơn mỗi ngày</p>
                        <div className="button_start">
                            <a  href="#">Bắt Đầu Thôi</a>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    );
}

export default Home;
